import React from "react";
import { ReactComponent as SvgLogo } from "../img/logo.svg";
import { Link } from "react-router-dom";

const Logo = () => (
  <div className={`logo ${window.location.pathname === "/" ? "homepage" : ""}`}>
    <Link to="/">
      <SvgLogo />
    </Link>
  </div>
);

export default Logo;
